import React from "react";

const InsightCard = ({ risk, message }) => {
  const riskColor =
    risk === "High"
      ? "bg-red-100 text-red-800"
      : risk === "Medium"
      ? "bg-yellow-100 text-yellow-800"
      : "bg-green-100 text-green-800";

  return (
    <div className={`p-3 rounded border ${riskColor} mb-2`}>
      <span className="font-semibold mr-2">{risk} Risk:</span>
      {message}
    </div>
  );
};

export default InsightCard;
